import { servicesVersion } from 'typescript';

const SugarServices = () => {
  const services = [
    {
      serviceName: 'Full Legs'
    }
  ];
  return (
    <div>
      {services.map((service, index) => (
        <div key={index}>
          <p>{service.serviceName}</p>
        </div>
      ))}
    </div>
  );
};

export default SugarServices;
